export function hash(str: string): number {
  let hashy = 0;
  for (let i = 0, len = str.length; i < len; i++) {
    const chr = str.charCodeAt(i);
    hashy = (hashy << 5) - hashy + chr;
    hashy |= 0; // Convert to 32bit integer
  }
  return hashy;
}

